I’m so honoured to be able to bring you the We Grow stage at @bbcgwlive this year.

I am a passionate advocate of the amazing gardening community that we have here on social media and I wanted to create a talks stage specifically for us, featuring the things we really care about, presented by the people we really love and respect.

So I have created this new stage right next to my show garden where I will be speaking each day and am so excited to be joined by the following group of amazing people!

@stephaniehafferty - No dig
@caleybrothers - Growing mushrooms 
@cloudgardeneruk -Edible container gardens
@gardenorganicuk - Organic allotment
@plot.81 - Forage your garden
@ukhouseplants - Creating indoor thickets
@agentsoffield - The good life
@sow_much_more - Soil ecology
@compost.club - Healthy soil healthy you
@yourorganicpt - Gardening for well-being
@dragqueen_gardener - Gardening and mental health

I really hope you will come and listen to some of these inspiring people share their specialist knowledge with you and then follow it up with a stroll through my edible show garden.
Can’t wait to see you there!
